import React from "react";

const Ham_Submenu = ({ items }) => {
  return (
    <div>
      {items.map((item, index) => (
        <div key={index}>
          <span className={`navitem w-[48px] text-2xl ${item.icon}`}></span>
          <span>{item.label}</span>
        </div>
      ))}
    </div>
  );
};

export default Ham_Submenu;
